</template>

<script>
export default {
  name: 'app',
  data() {
    return {
      photos: [],
      front: true,
      lastPhoto: null,
      constraints: {
        video: {
          facingMode: 'user',
          width: { ideal: 1280 },
          height: { ideal: 720 },
        },
      },
    };
  },
  created() {
    this.go();
  },
  computed: {
    date() {
      const now = new Date();
      return `${now.getDate()}.${now.getMonth() + 1}.${now.getFullYear()}`;
    },
  },
  methods: {
    async go() {
      try {
        const stream = await navigator.mediaDevices.getUserMedia(this.constraints);
        this.$refs.video.srcObject = stream;
      } catch (err) {
        console.log(err);
      }
    },
    takePhoto() {
      const margin = 40;
      const video = this.$refs.video;
      const canvas = this.$refs.canvas;
      const ctx = canvas.getContext('2d');

      canvas.width = video.videoWidth + (margin * 2);
      canvas.height = video.videoHeight + (margin * 2) + 80;
      ctx.fillStyle = '#ffffff';
      ctx.fillRect(0, 0, canvas.width, canvas.height);
      ctx.drawImage(video, margin, margin, video.videoWidth, video.videoHeight);
      ctx.textAlign = 'center';
      ctx.font = '700 80px "Exo 2"';
      ctx.fillStyle = '#000000';
      ctx.fillText(this.date, canvas.width / 2, canvas.height - 35);
      const data = canvas.toDataURL('image/jpeg');
      this.photos.push(data);
    },
    clear() {
      this.photos = [];
    },
    toggleCamera() {
      this.front = !this.front;
      this.constraints = {
        ...this.constraints,
        video: {
          ...this.constraints.video,
          facingMode: this.front ? 'user' : 'environment',
        },
      };
      this.go();
    },
  },
};
</script>

